package solution.medium.n1540

import org.junit.jupiter.api.Assertions.assertFalse
import org.junit.jupiter.api.Assertions.assertTrue
import org.junit.jupiter.api.Test

internal class SolutionTest {
    private val solution = Solution()

    @Test
    fun test1() {
        assertTrue(solution.canConvertString("input", "ouput", 9))
    }

    @Test
    fun test2() {
        assertFalse(solution.canConvertString("abc", "bcd", 10))
    }

    @Test
    fun test3() {
        assertTrue(solution.canConvertString("aab", "bbb", 27))
    }

    @Test
    fun test4() {
        assertFalse(solution.canConvertString("aabc", "bbb", 1000))
    }

    @Test
    fun test5() {
        assertFalse(solution.canConvertString("atmtxzjkz", "tvbtjhvjd", 35))
    }

    @Test
    fun test6() {
        assertFalse(solution.canConvertString("jicfxaa", "ocxltbp", 15))
    }

    @Test
    fun test7() {
        assertFalse(solution.canConvertString("arumplq", "yunkbjn", 9))
    }


    @Test
    fun test8() {
        assertFalse(
            solution.canConvertString(
                "yknovuqskmyqtsxceaiod",
                "rsfzbfiftibxnkaadirga",
                90
            )
        )
    }

    @Test
    fun test9() {
        assertTrue(
            solution.canConvertString(
                "",
                "",
                35909
            )
        )
    }

    @Test
    fun test10() {
        assertTrue(
            solution.canConvertString(
                "",
                "",
                547356
            )
        )
    }
}
